#include <iostream>
 
using namespace std;
 
int main()
{
    int m, count_pos, total_pos, d_a_m_i, d_a_m_j, diag_comp;
    float ar_mean, diff_ar_mean;
    
    count_pos=0;
    total_pos= 0;
    
    cout << "Введите размер массива В:" << endl;
    cin >> m;
    int B[m][m];
    
    for(int i = 0; i < m; i++)
    {
        for (int j = 0; j < m; j++)
        {
            cin>>B[i][j];
            if (B[i][j] > 0)
            {
                count_pos+=1;
                total_pos+=B[i][j];
            }
        }
    }
    
    ar_mean = total_pos/count_pos;
    
    diff_ar_mean = abs(B[0][0]-ar_mean);
    d_a_m_i = 0;
    d_a_m_j = 0;
    
    for(int i = 0; i < m; i++)
    {
        for (int j = 0; j < m; j++)
        {
            if (abs(B[i][j]-ar_mean) > diff_ar_mean)
            {
                diff_ar_mean = abs(B[i][j] - ar_mean);
                d_a_m_i = i;
                d_a_m_j = j;
            }
        }
    }
    
    diag_comp = 1;
    
    for(int i = 0; i < m; i++)
    {
        for (int j = 0; j < m; j++)
        {
            if ((i == j || i == m-j-1)&& B[i][j] != 0)
            {
                diag_comp*=B[i][j];
            }
        }
    }
    
    for(int i = 0; i < m; i++)
    {
        for (int j = 0; j < m; j++)
        {
            cout<<B[i][j] << " ";
        }
        cout<< endl;        
    }
 
    cout << "Cреднее арифметическое значение положительных элементов: " << ar_mean << endl;
    cout << "Bндексы элемента, наиболее отличающегося от среднегоарифметического всех элементов равны: " << d_a_m_i << " "<< d_a_m_j << endl;
    cout << "Произведение ненулевых элементов на диагоналях матрицы: " << diag_comp;
    return 0;
}

#include <iostream>
using namespace std;

int main() {
    int n, m, min_l;

    cout << "Введите количество строк:"<<endl;
    cin >> n;
    
    cout << "Введите количество столбцов" << endl;
    cin >> m;

    int H[n][m];

    for (int i = 0; i < n; i++)
    {
        for (int j = 0; j < m; j++)
        {
            cout << "Введите элемент массива: " << endl;
            cin >> H[i][j];
        }
    }

   cout << "Массив до изменений:" << endl;
   for (int i = 0; i < n; i++)
    {
        for (int j = 0; j < m; j++)
        {
            cout << H[i][j] << " ";
        }
        cout << endl;
    }
   
   
    for (int j = 0; j < n; j++)
    {
        min_l = H[0][j];
        for (int i = 0; i < m; i++) 
        {
            if (H[i][j] < min_l) 
            {
                min_l = H[i][j];
            }
        }
        if (j % 2 == 0) {
            H[0][j] = min_l;
        } 
        else 
        {
            H[n - 1][j] = min_l;
        }
    }

    cout << "Массив после изменений:" << endl;
    
    for (int i = 0; i < n; i++)
    {
        for (int j = 0; j < m; j++)
        {
            cout << H[i][j] << " ";
        }
        cout << endl;
    }

    return 0;
}

