using namespace std;

double lagrange(double x[], double y[], double xx, int n) {
  int i, j;
  double *a, yy = 0;
  a = new double[n];
  for (i = 0; i < n; i++) {
    a[i] = y[i];
    for (j = 0; j < n; j++) {
      if (j == i) continue;
      a[i] *= (xx - x[j]) / (x[i] - x[j]);
    }
    yy += a[i];
  }
  delete a;
  return yy;
}

int main() {
  double x[] = {0.30, 0.42, 0.50, 0.58, 0.66, 0.72};
  double y[] = {1.04403, 1.08462, 1.11803, 1.15603, 1.19817, 1.23223};
  cout << "y|x=0.46 = " << lagrange(x, y, 0.46, 6) << endl;
  cout << "y|x=0.55 = " << lagrange(x, y, 0.55, 6) << endl;
  cout << "y|x=0.60 = " << lagrange(x, y, 0.60, 6) << endl;
  
  return 0;
}

